import React from 'react';
import { View, Text } from 'react-native';
import Hibernacle from '../components/Hibernacle';

function Home() {
  return (
    <View style={{ alignItems: 'center', justifyContent: 'center', flex: 1 }}>
      <Hibernacle />
    </View>
  );
}
export default Home;
